query GetMemberQuery($firstName: String!, $lastName: String!, $dateOfBirth: String!, $subscriberId: String!) {
  searchMember(
    searchInput: {firstName: $firstName, lastName: $lastName, dateOfBirth: $dateOfBirth, masterIdentifiers: {subscriberId: $subscriberId}}
  ) {
    individual {
      personNames {
        firstName
        middleName
        lastName
        __typename
      }
      birthDate
      genderType
      telephoneNumbers {
        active
        telephoneNumber
        __typename
      }
      postalAddresses {
        preferredIndicator
        primaryIndicator
        addressType
        line1Text
        line2Text
        townName
        postalCode
        stateProvinceCode
        __typename
      }
      masterIdentifiers {
        memberId
        sourceId
        sourceCode
        subscriberId
        __typename
      }
      __typename
    }
    __typename
  }
}
